import Foundation

class Solution3 {
    func lengthOfLongestSubstring(_ s: String) -> Int {
        var map: [Character: Int] = [:]
        var maxCount: Int = 0
        for (index, character) in s.enumerated() {
            if let lastIndex = map[character] {
                map[character] = index
                
                let count = map.count
                if maxCount <= count {
                    maxCount = count
                }
                map = map.filter({ (element) -> Bool in
                    return element.value > lastIndex
                })
            } else {
                map[character] = index
                let count = map.count
                if maxCount <= count {
                    maxCount = count
                }
            }
        }
        
        return maxCount
    }
    func lengthOfLongestSubstring2(_ s: String) -> (Int, Int) {
        var map: [Character: Int] = [:]
        var maxCount: Int = 0
        var startIndex: Int = 0
        for (index, character) in s.enumerated() {
            if let lastIndex = map[character] {
                map[character] = index
                
                let count = map.count
                if maxCount <= count {
                    maxCount = count
                    
                    startIndex = map.values.min()!
                }
                map = map.filter({ (element) -> Bool in
                    return element.value > lastIndex
                })
            } else {
                map[character] = index
                let count = map.count
                if maxCount <= count {
                    maxCount = count
                }
            }
        }
        
        return (maxCount, startIndex)
    }
    
    
    /// O(n^3)
    func lengthOfLongestSubstring3(_ s: String) -> (Int, Int) {
        var maxCount: Int = 0
        var startIndex: Int = 0
        
        func allUnique(_ s: String, start: Int, end: Int) -> Bool {
            var st = Set<Character>()
            for i in start ..< end {
                let index = s.index(s.startIndex, offsetBy: i)
                let char = s[index]
                if st.contains(char) {
                    return false
                }
                st.insert(char)
            }
            return true
        }
        
        for i in 0 ..< s.count {
            for j in i+1 ... s.count {
                if allUnique(s, start: i, end: j), maxCount <= (j - i) {
                    maxCount = (j - i)
                    startIndex = i
                }
            }
        }
        
        return (maxCount, startIndex)
    }
    
    func lengthOfLongestSubstring4(_ s: String) -> Int {
        var maxCount: Int = 0
        
        var st = Set<Character>()
        let n = s.count
        var i = 0
        var j = 0
        while i < n && j < n {
            
            let index = s.index(s.startIndex, offsetBy: j)
            let char = s[index]
            if !st.contains(char) {
                st.insert(char)
                j += 1
                maxCount = max(j - i, maxCount)
            } else {
                st.remove(s[s.index(s.startIndex, offsetBy: i)])
                i += 1
            }
        }
        
        return maxCount
    }
    
